An extension for defining a pex toolchain. An example of defining and using a pex toolchain: pex = use_extension("//pex:extensions.bzl", "pex")
pex.toolchain( name = "pex_toolchains", pex_version = "2.67.3", python_version = "3.11", scie_science_version = "0.15.0", scie_jump_version = "0.15.0", scie_ptex_version = "0.15.0",
)
use_repo(pex, "pex_toolchains")
register_toolchains( "@pex_toolchains//:all"
) Attributes Name Description Type Mandatory Default name The name of the repository hub to create. Name required pex_version The version of pex to download. String optional "2.67.3" python_version The Python version (e.g., '3.11'). String optional "3.11" scie_jump_version The version of scie jump to download. String optional "1.8.0" scie_ptex_version The version of scie ptex to download. String optional "1.7.0" scie_science_version The version of scie science to download. String optional "0.15.0"

