First ensure rules_venv is setup by referring to rules_venv setup . Next, the pex rules work mostly off of toolchains which are used to provide the necessary python targets (aka pex) for the process wrappers. Users will want to make sure they have a way to get the necessary python dependencies. Tools such as req-compile can provide these. With the appropriate dependencies available, a py_pex_toolchain will need to be configured: load("@rules_venv//pex:defs.bzl", "py_pex_toolchain") py_pex_toolchain( name = "toolchain_impl", pex = "@pip_deps//:pex", visibility = ["//visibility:public"]
) toolchain( name = "toolchain", toolchain = ":toolchain_impl", toolchain_type = "@rules_venv//pex:toolchain_type", visibility = ["//visibility:public"]
) This toolchain then needs to be registered in the MODULE.bazel file. register_toolchains("//tools/python/pex:toolchain")
